import React from 'react';
import {View,
        Text,
        TouchableOpacity,
        StyleSheet,
        Dimensions,
        Image } from 'react-native';


const InitialScreen= () => {
    return(
        <View  style={{alignItems: 'center',
                        backgroundColor: 'white '}}>
            <Image
                source={require('../../assets/5fb4b597dcc35.jpg')}
                style={styles.image}
            />
            <View style={styles.mainComponent}>
                <TouchableOpacity //Button for Sign-In button
                    onPress={() => {}}
                    style={{alignItems: 'center',
                            justifyContent: 'center'}}
                >
                     <View style = {styles.viewComponent}>
                        <Text style = {styles.textComponent}>Sign-In</Text>
                    </View>
                </TouchableOpacity>

                <TouchableOpacity //Button for Log-In Button
                    onPress={() => {}}
                    style={{alignItems: 'center',
                            justifyContent: 'center',
                            marginTop: 10}}
                >
                    <View style = {styles.viewComponent}>
                        <Text style = {styles.textComponent}>Log-In</Text>
                    </View>
                </TouchableOpacity>
    </View>
        </View>
    );
}

const styles = StyleSheet.create({
    viewComponent: {
        backgroundColor: '#16a596', 
        alignItems: 'center', 
        justifyContent: 'center', 
        borderRadius: 100,
        width: (Dimensions.get('window').width)*(0.5),
        height: 50
    },
    textComponent: {
        color: 'black',
        fontWeight: 'bold',
        fontSize: 20
    },
    mainComponent : {
        marginTop: (Dimensions.get('window').height)*(0.25)
    },
    image: {
        height: 200,
        width: (Dimensions.get('window').width)*(0.5),
        resizeMode: 'stretch',
        alignItems: 'center'
    }
});
export default InitialScreen;
